import React from 'react';

class Formu extends Component {
	constructor(props) {
		super(props);
		this.state = {
			title: '',
			globalTitle: ''
		};
	}
	render() {
		return (
			<div>
				<form>
					<fieldset>
						<legend>Formulaire</legend>
						<div>
							<label htmlFor='title'>Title</label>
							<input type='text' id='title' name='title' />
						</div>

						<hr />
						<div>
							<input type='submit' value='Envoyer' />
						</div>
					</fieldset>
				</form>
			</div>
		);
	}
}

export default Formu;
